(def trans-samples-yeom
  (vec
    (map :result
       (take 100 (take-nth 10 (drop 1000 (doquery :ipmcmc inference [probs-yeom])))))))
(def trans-samples-hong
  (vec
    (map :result
       (take 100 (take-nth 10 (drop 1000 (doquery :ipmcmc inference [probs-hong])))))))
